import Link from "next/Link";

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <header>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/contact">
      <a style={linkStyle}>Contact</a>
    </Link>
    <Link href="/blog">
      <a>Blog</a>
    </Link>
    <style jsx>{`
      header {
        display: flex;
        justify-content: space-between;
      }
    `}</style>
  </header>
);

export default Header;
